import React from 'react';

const Weather = ({ weather,loading}) => {

    if(loading)
        return<h2>Loading...</h2>
    return(
        <ul>
            {weather.map(weathers => <div>{weathers.name}</div>)}
              
            
            
        </ul>
        

    );
};

export default Weather;
